import React from"react";
import imghome from "./projectimages/img1.png";

const Home=()=>{


    return(
        <>
<div className="container">
  <div className="row">
  <div className="col-md-10">
    <div className="col-sm-10 col-md-5 home_head">
      <h1>Welcome to our Homepage</h1>
      <h2>500 students placement in just 1 year <br/>
      thats why we are the best training institute
      in Silvassa </h2>
      <button className="home_btn">Get Admission</button>
    </div>
    <div className="col-sm-10 col-md-5 homeimage_d">
    <img src={imghome} width="300px" height="300px" alt="img1"/>
    </div>
    </div>
  </div>
</div>

        </>
  

    )

};

export default Home;
